4778	4890	cheat_sheets	17	{"id":17,"sort":null,"date_created":"2025-10-22T10:39:34.925Z","date_updated":"2025-11-03T12:23:54.874Z","title":"Intro Talk - EN","content":"# Interview Introduction Cheat Sheet\\n\\n## Main\\n\\n- Dutch Senior Full Stack Developer\\n- 18+ years of experience\\n- currently based in Spain\\n- specialize in Python & Node.js ecosystems\\n- Strong on both back & frontend\\n\\n## More\\n\\n- Lot of experience scaling high-traffic applications\\n- 5+ years remote work experience\\n- Experience in both startup and enterprise environments\\n- Agile methodologies experience\\n\\n## Chipta\\n\\n- 10 years Lead Developer @ Chipta\\n- Managed teams of 3-5 developers\\n- Built ticketing platform:\\n  - Served thousands of events\\n  - Processing thousands of tickets/minute\\n  - Processed tens of millions in ticket sales\\n- High-traffic page performance improvements (40-60%)\\n\\n### Achievements\\n\\n- Transformed proof-of-concept into competitive ticketing platform\\n- Serving thousands of events\\n- Processing high-volume traffic reliably\\n\\n### Left because\\n\\nDidn't reach the breakthrough we hoped for.\\n\\n## Tender-it\\n\\n- Built complete platform from scratch\\n- Agile workflow with non-technical founders\\n- Extensive search engine using Elasticsearch\\n- Crawling websites, process & import data\\n- Built subscription system with recurring payments\\n\\n### Achievements\\n\\n- Delivered complete product to requirements of founders\\n- Helping companies find appropriate tenders easily\\n\\n### Left because\\n\\nCompetitor overtook us.\\n\\n## TravelBird\\n\\n- Rapidly growing company\\n- Part of innovative mobile team\\n- Objective-C + XCode\\n- API architect for mobile apps\\n\\n### Left because\\n\\nWasn't satisfied with company reorganization.\\n\\n##  Technical Expertise\\n\\n### Expert\\n\\n- Python (Django, DRF, Channels, Silk, Celery)\\n- JavaScript/Node.js (React, MobX, Svelte, Lit, Webcomponents)\\n- SQL databases (PostgreSQL, MySQL, SQLite)\\n- Linux, DevOps, CI/CD\\n- Vercel, Linode, AWS\\n- AI-accelerated development (Claude Code, Cursor)\\n\\n## Work principles\\n\\n- Agile, Scrum, Kanban\\n- Security-first mindset\\n- TDD\\n- Component-based development\\n- UX\\n- Code reviewing\\n- Documentation\\n\\n## Concrete Achievements\\n\\n- Platform scaling\\n  - Profiling\\n  - Query optimization\\n  - Algorithmic optimization\\n  - Caching\\n  - Load balancing\\n  - Auto-scaling servers\\n\\n- API integrations\\n  - Connect DB to third-parties\\n  - OAuth integrations for account sharing\\n\\n- Payment integrations\\n  - Mollie\\n  - Pay.nl\\n  - Adyen\\n  - Paypal\\n\\n- Internationalization\\n  - Translations\\n  - Location-aware content\\n  - Multi-currency support\\n\\n- Test suite\\n  - TDD\\n  - Unit tests\\n  - Integration tests (with Selenium)\\n\\n##  Personal Touch (when appropriate)\\n\\n- Playing guitar since age 12, had a band\\n- Got into web development by creating website for band\\n- Travel & nature lover\\n  - Walked Camino de Santiago\\n  - Traveled around Mexico & Ecuador\\n\\n## Current situation\\n\\n- Renting out house in NL\\n- Traveled south in camper\\n- Family/friends across Spain & Portugal\\n- Currently working from sister's office in southern Spain\\n  - Plenty of space & dedicated workspace\\n\\n## What I'm Looking For\\n\\n- Remote work\\n- Projects 6-12 months\\n- Long-term part-time\\n- Innovative agile (startup) environments\\n\\n## Recent technologies of interest?\\n\\n- AI-accelerated development (Claude, Cursor)\\n- AI / LLM integrations (OpenAI API)\\n- Svelte & Tailwind\\n- Machine Learning & Data Science\\n\\n## Recent projects\\n\\n- Handy House Manual\\n- SmartFeed\\n- Smart Home integrations (ESP32, Raspi)\\n- Portfolio & CV\\n\\n---\\n\\n## Common Follow-up Questions\\n\\n### Challenging projects?\\n\\n- Scaling (Chipta)\\n  - Figuring out what/why slow\\n  - How to optimize\\n  - Testing optimizations\\n\\n- Team leadership (Chipta)\\n  - Guidance, what someone needs\\n  - Estimate someone's skills\\n  - Reviewing code & giving feedback\\n\\n- Developing complete project (Tender-it)\\n  - Taking responsibility of full stack\\n    - Dealing with problems on all layers of stack\\n  - Scrum planning\\n  - Coordinating with non-technical founders\\n\\n- Mobile app development (TravelBird & Chipta)\\n  - Learning new technologies\\n  - App/Play store review policies\\n  - Testing on various devices\\n  - Web Sockets for Chipta Scan App\\n\\n### Why remote work?\\"\\n\\n- Love traveling & nature\\n- Efficiency & flexibility\\n- Stay focussed with Scrum / Agile methodologies\\n- Collaboration software (Slack, Teams, Zoom)\\n- 5+ years experience\\n- I believe in it\\n","profile":2}	{"content":"# Interview Introduction Cheat Sheet\\n\\n## Main\\n\\n- Dutch Senior Full Stack Developer\\n- 18+ years of experience\\n- currently based in Spain\\n- specialize in Python & Node.js ecosystems\\n- Strong on both back & frontend\\n\\n## More\\n\\n- Lot of experience scaling high-traffic applications\\n- 5+ years remote work experience\\n- Experience in both startup and enterprise environments\\n- Agile methodologies experience\\n\\n## Chipta\\n\\n- 10 years Lead Developer @ Chipta\\n- Managed teams of 3-5 developers\\n- Built ticketing platform:\\n  - Served thousands of events\\n  - Processing thousands of tickets/minute\\n  - Processed tens of millions in ticket sales\\n- High-traffic page performance improvements (40-60%)\\n\\n### Achievements\\n\\n- Transformed proof-of-concept into competitive ticketing platform\\n- Serving thousands of events\\n- Processing high-volume traffic reliably\\n\\n### Left because\\n\\nDidn't reach the breakthrough we hoped for.\\n\\n## Tender-it\\n\\n- Built complete platform from scratch\\n- Agile workflow with non-technical founders\\n- Extensive search engine using Elasticsearch\\n- Crawling websites, process & import data\\n- Built subscription system with recurring payments\\n\\n### Ach