2	published	2025-10-30 15:52:08.473+00	2025-10-30 16:00:46.972+00	https://www.linkedin.com/jobs/view/4332442558/	Senior Python Developer	Senior Backend Engineer (Django)  Remote Europe | 100k + Equity\n\n\nFoxley Talent's client is a fast growing creative AI startup on a mission to make visual creation effortless. Their web and mobile apps with Django at their core use cutting edge generative technology to help millions of users produce professional quality imagery in seconds and empowering creators, small businesses, and global brands alike.\n\n\nWith hundreds of millions of downloads and billions of assets processed annually, the platform operates at massive scale, blending world class design with serious engineering. They are profitable, expanding quickly, and now hiring a Senior Backend Engineer with expertise in Django to join their (almost fully remote) European team.\n\n\nThe Role\n\nAs a Senior Backend Engineer, youll help design and deliver new features for a high volume, user centric platform. Youll work closely with other engineers, product teams, and data specialists to keep the system fast, reliable, and intuitive.\n\n\nYoull own your work end to end: from architecture and implementation to monitoring and optimisation. Expect to iterate quickly, release often, and see your code impact millions of users around the world.\n\n\nWhat Youll Be Working On\n\n    Build and maintain scalable backend services using Python, Django, and Django REST Framework\n    Collaborate with frontend teams using TypeScript, React, and GraphQL to design efficient APIs\n    Optimise and refactor existing endpoints to reduce latency and support large-scale traffic\n    Design and evolve relational database schemas (PostgreSQL) and manage migrations with minimal downtime\n    Monitor performance and reliability using tools such as Datadog and Sentry\n    Ship frequently in an agile, experimentation driven environment\n    Contribute to architectural discussions, tooling improvements, and developer experience\n\n\nKey Requirements\n\n    5+ years of experience building backend systems with Python and Django\n    Solid understanding of relational databases and query optimisation at scale (100GB+)\n    Experienced in designing and documenting APIs for internal and external use\n    Strong sense of ownership. It helps if you care deeply about quality, reliability, and speed!\n    Pragmatic and product focused. Valuing iteration and simplicity over "over engineering"\n    Fluent in English and comfortable working remotely across time zones\n\n\nNice to haves\n\n    Familiarity with GCP or similar cloud platforms\n    Exposure to large scale consumer or creative tech products\n    Experience working closely with design driven or AI focused teams\n\n\nThe Offer\n\n    100k base salary (flexible for exceptional profiles) this will be paid through an employer of record service like Deel\n    Equity package / stock options\n    Fully remote across Europe, with paid travel for quarterly team meetings\n    30 days paid leave + local public holidays\n    Annual learning & development budget\n    Home office setup budget or co-working allowance\n    Private health coverage and wellness support\n\n\nHow To Apply\n\nApply now through Foxley Talent to find out more about this new opportunity. Send your latest CV and reasons for your interest in the role to hello@foxleytalent.com and we will review your application.\n\n\nPlease note, this role is ONLY open to those currently based in Europe and no applications from residents outside of this region will be considered.\n\nThe company is not offering visa sponsorship or relocation.\n\nPlease only apply if you are in the location specified.	Foxley Talent	linkedin
1	published	2025-10-30 14:29:32.244+00	2025-10-30 16:01:00.64+00	https://www.linkedin.com/jobs/view/4332717701/	Senior Full Stack Engineer - Profitable AI Startup	Senior Full Stack Engineer (Remote  Europe)\n\n\nSartre is partnered with a profitable, independent AI startup founded by experienced engineers who previously built large-scale systems at top tech companies. Theyre building modern data and infrastructure platforms that power advanced AI applications, and are now expanding their small, senior engineering team across Europe.\n\n\nWere looking for a Senior Full Stack Engineer who enjoys building reliable systems end to end, someone comfortable working across backend services, APIs, and front-end interfaces. The ideal candidate has experience in fast-paced startups, strong backend skills, and a generalist mindset.\n\n\nWhat Youll Do\n\n    Design, build, and maintain full-stack applications and internal data tools.\n    Work closely with founders and senior engineers to deliver production systems.\n    Contribute ideas on architecture, automation, and product design.\n    Help scale tools and workflows used in high-performance AI environments.\n\n\nWhat Were Looking For\n\n    5+ years of software engineering experience.\n    Degree in Computer Science, Engineering, or a related technical field, or equivalent practical experience\n    Proven track record in a reputable, fast-moving product company or startup.\n    Strong in Python or Java, with JavaScript (experience with Django and Svelte is a plus).\n    Hands-on experience building backend-heavy systems or workflow tools.\n    Curious, self-driven, and comfortable working with autonomy.\n\n\nWhy This Role\n\n    Build systems used by leading AI companies.\n    Work directly with experienced founders in a small, high-ownership team.\n    Fully remote, most of the team within Europe\n    Competitive compensation and meaningful equity for early joiners.\n\n\nIf youre an experienced full-stack or backend engineer who wants to work on technically interesting products in a small, high-impact environment, Id love to share more.\n\n\nLocation: Remote (Europe preferred)\n\nExperience: 5+ years\n\nTech: Python, TypeScript, Django, Svelte (or similar)\n\nProcess: Intro chat  Take-home  Technical and culture interviews	Sartre Group	linkedin
3	published	2025-11-03 13:52:27.441+00	2025-11-03 15:11:13.54+00	https://www.linkedin.com/jobs/view/4333275011/	Fullstack Software Developer	Job Title: Fullstack Engineer\n\n\nJob Type: Full-time\n\n\nLocation: Remote\n\n\nAbout Us:\n\n\nThe AI platform for human intelligencewe build models that rigorously vet PhDs and scale human data training for frontier LLMs.\n\n\nOur agent, Zara, autonomously sources and evaluates world-class researchers and data trainerspowering post-training (RLHF, evals, red-teaming) for top AI labs, modernizing staffing firms, and helping startups hire their core AI teams.\n\n\nAbout the Role:\n\nJoin us as a Fullstack Software Engineer to design, build, and scale high-impact applications from front to back. Youll architect robust APIs, craft intuitive interfaces, and deploy secure, cloud-native solutions. We value engineers who write clean code, communicate clearly, and thrive in collaborative environments.\n\n\nKey Responsibilities:\n\n    Develop, deploy, and maintain REST APIs and microservices using Python (FastAPI/Flask) or Node.js (TypeScript/Express/Koa).\n    Build performant, maintainable frontend applications using React.js and Next.js (SSR, SSG, dynamic routing, API routes).\n    Implement state management with Redux Toolkit, Zustand, or React Query.\n    Design and optimize PostgreSQL schemas and queries for scalability and reliability.\n    Create responsive, pixel-perfect UIs with TailwindCSS and Styled Components.\n    Integrate with internal/external APIs (e.g., Slack, Google Sheets).\n    Deploy, monitor, and secure apps using AWS (EC2, S3, Lambda, CloudFront, etc.) and Nginx.\n    Maintain clean, well-documented code and participate in code reviews.\n\n\nWhat We're Looking For:\n\n    Deep hands-on experience with React.js, Next.js, and TypeScript.\n    Proven ability to build and scale backend systems in Python or Node.js.\n    Strong understanding of state management, asynchronous programming, and PostgreSQL optimization.\n    Experience with AWS and Nginx in production environments.\n    Exceptional attention to UI detail and cross-browser responsiveness.\n    Excellent communication and collaboration skills.\n\n\nNice to Have:\n\n    Experience with workflow automation, CI/CD, Docker/Kubernetes, or Infrastructure as Code (Terraform, Ansible).\n    Familiarity with Pydantic, advanced TypeScript types, and performance optimization for distributed systems.	micro1	linkedin
4	published	2025-11-03 16:12:07.459+00	2025-11-03 16:21:27.464+00	https://sveltejobs.com/jobs/full-stack-developer-for-innovative-projects-at-penbrothers-8ab4	Full-Stack Developer for Innovative Projects	    You'll work on everything from sleek, intuitive UIs for our customers to backend services that process and integrate AI-transformed orders.\n    Build and refine web applications using Svelte/React for customer-facing and internal tools.\n    Develop backend services in Go, connecting to Postgres databases.\n    Collaborate with AI engineers to integrate OpenAI and in-house ML models into production workflows.\n    Work with Kubernetes (K8s) to deploy and scale services.\n    Ensure smooth data flow into ERP systems with a focus on reliability and correctness.\n    Contribute to product design, from brainstorming UX flows to shaping technical architecture.\n\nRequirements\n\n    Strong experience in modern frontend frameworks (Svelte and/or React or similar technologies).\n    Solid knowledge of backend languages (Go, Python, etc.)\n    Comfort with Postgres and relational data modeling.\n    Familiarity with Kubernetes, Docker, and cloud-native deployments.\n    Experience integrating APIs (bonus if with AI/LLM APIs like OpenAI).\n    A product-focused mindset: you care about end-users and real-world impact.\n    Ability to thrive in a small, collaborative team with lots of autonomy.\n\nBenefits\n\n    Meaningful work & Growth: We take every opportunity to stretch ourselves and deliver an excellent client experience.\n    Employee as our biggest asset: We are genuinely invested in our peoples career and welfare.\n    Global reach & local impact: Get to work with high-growth startups and dynamic companies from the comfort of your own home.\n    Powering global startups: Weve created 1,400 Filipino jobs that empower global start-ups to focus on growth.	Penbrothers	svelte_jobs
5	published	2025-11-03 16:33:34.294+00	\N	https://www.linkedin.com/jobs/view/4332169828/	Python Software Developer (Fully Remote)	Senior Software Engineer \n\n\nKey Responsibilities:\n\n    Design and implement scalable, maintainable, and well-documented systems and APIs.\n    Develop and maintain services in Python with a strong focus on Django, async programming, typing, pydantic, and pytest.\n    Apply SOLID principles, data structures, and algorithms to ensure clean, maintainable code.\n    Build and integrate systems in event-driven architectures.\n    Develop solutions leveraging YANG models, gNMI/gNOI protocols, and industry API specifications (TMF API, OpenAPI).\n    Contribute to cloud-native development workflows, including Docker, Helm, and Ansible.\n    Collaborate with cross-functional teams to ensure system reliability, performance, and security.\n    Write clear documentation and contribute to knowledge-sharing within the team.\n\n\nRequired Skills & Experience:\n\n    High proficiency in Python, with practical experience in Django, Typing, Pydantic, Pytest.\n    Strong background in systems/API/interface design and documentation.\n    Experience with event-driven architecture.\n    Experienced in YANG modeling, gNMI/gNOI protocols, and API standards (TMF, OpenAPI).\n    Hands-on experience with cloud-native technologies: Docker, Helm, Ansible.	Moralis	linkedin
